"use client"

import React, {useEffect, useRef, useState} from 'react';
import {AppRouterInstance} from "next/dist/shared/lib/app-router-context.shared-runtime";

const iconB64 = "data:image/png;base64,"
// 我就要夹带私货！！！
const avatarB64 = "data:image/jpeg;base64,"

export default function Navbar(props: {userName: string, router: AppRouterInstance}) {
    const [dropdownOpen, setDropdownOpen] = useState(false);
    const dropdownRef = useRef(null);

    const toggleDropdown = () => {
        setDropdownOpen(!dropdownOpen);
    };

    const handleClickOutside = (event: { target: any; }) => {
        // @ts-ignore
        if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
            setDropdownOpen(false);
        }
    };

    function handleLogout(){
        localStorage.removeItem("hfs_token")
        alert("已退出登录，返回登录页")
        props.router.push("/")
    }

    function handleSettings() {
        props.router.push("/settings")
    }

    useEffect(() => {
        document.addEventListener('mousedown', handleClickOutside);
        return () => {
            document.removeEventListener('mousedown', handleClickOutside);
        };
    }, []);

    return (
        <nav className="p-4 flex justify-between items-center rounded-lg shadow-sm border-gray-200 border">
            <div className="text-white">
                {/* eslint-disable-next-line @next/next/no-img-element */}
                <a href="/exams"><img src={iconB64} alt="Icon" className="h-8 w-28" /></a>
            </div>
            <div className="relative" ref={dropdownRef}>
                <button onClick={toggleDropdown} className="focus:outline-none flex items-center space-x-2">
                    {/* eslint-disable-next-line @next/next/no-img-element */}
                    <img src={avatarB64} alt="Avatar" className="h-8 w-8 rounded-full" />
                    <div className="font-black hover:text-amber-600">
                        {props.userName + " (点我!)"}
                    </div>
                </button>
                {dropdownOpen && (
                    <div className="absolute right-0 mt-2 w-48 bg-white rounded-md shadow-lg py-1 z-20">
                        <div className="block px-4 py-2 text-gray-800 hover:bg-gray-200" onClick={()=>{alert("查完成绩心情不好？我的建议是去玩一玩千恋万花，没别的意思，只是想让你看看芳乃有多可爱，白毛巫女赛高！")}}>
                            tips: 这头像是我夹带的私货，芳乃可爱捏~
                        </div>
                        <div className="block px-4 py-2 text-gray-800 hover:bg-gray-200"
                             onClick={handleSettings}>设置
                        </div>
                        <div className="block px-4 py-2 text-gray-800 hover:bg-gray-200"
                             onClick={handleLogout}>退出登录
                        </div>
                    </div>
                )}
            </div>
        </nav>
    );
};